import React from "react";
import { Link } from "react-router-dom";

const Productt = ({id, name, brand, imgUrl, price, currency }) => {
    return (
        <Link className=" flex flex-col align-center mr-4 mb-4 px- py-4 border transform hover:scale-105 hover:shadow-2xl transition delay-50 ease-in-out " to={`/about/${id}`}>
                        <img width='120' src={`https://${imgUrl}`} alt={name} className=" mx-auto"  />
                        <p className=" text-yellow text-sm lowercase font-font-krona">{name}</p>
                        <p>{brand} </p>
                        <p className=" font-font-krona text-lg">
                            {price} {currency}
                        </p>
                </Link>
    )
}

export default Productt
